import { useState } from "react";
import '../styles/styles.css';
import styled from 'styled-components'

const Icon = ({ children }) => (
  <i className="material-symbols-outlined">{children}</i>
);

const Button = () => {

  const [isOpen, setIsOpen] = useState(false);

  return (
    <ButtonContainer className={`fab ${isOpen ? "open" : ""}`}>
    <button onClick={() => setIsOpen(!isOpen)}>
      <Icon>add</Icon>
    </button>
    <div className="menu">
      <button>
        <Icon>GitHub</Icon>
        <span>GitHub</span>
      </button>
      <button>
        <Icon>Linkedin</Icon>
        <span>Documents</span>
      </button>
      <button>
        <Icon>Email</Icon>
        <span>Settings</span>
      </button>
    </div>
  </ButtonContainer>
  )
}

export default Button


const ButtonContainer = styled.div`


